import React from 'react'

const Title: React.FC<{
  title: string
  color: string
  size: number
}> = props => {
  return (
    <div
      className="title"
      style={{ color: props.color, fontSize: props.size * 2 }}
    >
      {props.title}
    </div>
  )
}

const Component = () => {
  return (
    <div className="index">
      top page
      <Title title="nepota" color="pink" size={100} />
    </div>
  )
}

export default Component
